import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <React.Fragment>
        <nav className="navbar navbar-dark bg-dark mb-3">
          <ul>
          <li><a className="badge badge-secondary" href="#hero">Home</a></li>
          <li><a class="nav-link scrollto" href="#services">Hyperloop</a></li>
          <li><a class="nav-link   scrollto" href="#portfolio">News</a></li>
          <li><a class="nav-link scrollto" href="team.html">Our Team</a></li>
          <li><a class="nav-link" href="join.html">Join us</a></li>
          </ul>
        </nav>
      </React.Fragment>
    );
  }
}

export default NavBar;
